insert  into `articles`(`id`,`title`,`content`,`created_at`,`updated_at`) values 
(3,'关于我们','<pre><code><p>“设备猫”是隶属于广州欢创人力资源集团有限公司旗下的设备租赁平台。平台专注于重工机械为核心，致力于为客户提供重机械产品服务。</p></code></pre><pre><code><p>广州欢创人力资源集团有限公司，公司成立于2010年5月21日，是一家专注人力资源服务和提升人力资源运营绩效的供应商。总部位于广州市番禺区，主营业务：委托招聘、劳务派遣、五险代理、人事代理、人力资源服务外包、酒店人力资源外包、残疾人安置、薪税保筹划服务。</p></code></pre><pre><code><p>公司成立至今本着“诚信为本，创新服务，敢于挑战，追求卓越”的经营理念，形成了立足广州，辐射珠三角地区及全国各地的业务板块，现已在全国设立30多家分公司，实行属地化管理，是中国人力资源行业规模较大、专业较强、客户满意度较高的人力资源服务商之一。</p></code></pre><pre><code><p>公司始终坚持“为客户提供人才创造价值，为人才提供平台展现自我，为平台打造标准引领发展”的企业使命，赢得了客户的信任和支持，现服务客户1500多家，赢得客户好评。</p></code></pre><pre><code><p>地址：广州市番禺区基盛万科大厦A栋301室</p></code></pre><pre><code><p>联系电话：020-22091341</p></code></pre><pre><code><p>email：H@gzhclw.com</p></code></pre><pre><code><p>公司网站：http://gzhclw.com/</p></code></pre>','2020-07-31 15:17:43','2020-08-03 14:17:14');
